import { Routes, Route } from 'react-router-dom';
import StorePage from './pages/StorePage/StorePage';

const AppRoutes = (props) => {


    const { cart, addToFavorite, setModalProps, setIsModalActive, data } = props




    return (
        <Routes>

            <Route path='/' element={<StorePage addToFavorite={addToFavorite} setModalProps={setModalProps} setIsModalActive={setIsModalActive} data={data} />} />

            {/* <Route path='/cart' element={<CartPage />} /> */}

            {/* <Route path='/favorite' element={<FavoritePage />} /> */}

        </Routes>
    )
}
export default AppRoutes;
